import React from 'react'

export default function Forms(props) {
    return (
          <><h1>{props.title}</h1>
        <div class="form-check">
        <input class="form-check-input" type="checkbox" id="disabledFieldsetCheck"  rows='8' />
     
          Can't check this
       </div>
       </>
  )
}
